import React from 'react';
import LoginForm from '../components/auth/LoginForm';

const LoginPage = () => {
  return (
    <div>
      <h1 className="text-2xl font-bold text-center mb-4">Login</h1>
      <LoginForm />
    </div>
  );
};

export default LoginPage;
